Comet Collision (HD)

Science Documentary hosted by Josh Davis, published by Discovery Channel in 2005 - English narration


Information
------------------------------

In July 2005, NASA's Deep Impact probe collided with comet Tempel 1, providing the first-ever glimpse of the interior of one of these &quot;dirty snowballs&quot; and valuable insight into the formation of our solar system. NASA's brilliant, but risky, plan to send a tiny, copper-plated probe hurtling directly towards the city-sized comet at a speed of 23,000 mph was a smashing success. The resulting explosion of particles provided experts with new data about the composition of life-building materials that were present in the early solar system. Watch as state-of-the-art spacecraft animation and stunning location photography bring the mission to life, taking viewers behind the scenes of NASA's high-profile mission. Follow the entire journey of the doomed Deep Impact probe, from its initial design to the extraordinary challenge of building a spacecraft that's intended to be smashed to pieces.

